import React from 'react';
import { Link } from 'react-router-dom';

export default function Footer() {
  return (
    <div className="footer">
        <ul className="footer-list">
          <li className="footer-list-item">
            <Link to="/about" className="footer-items">Dashboard</Link>
          </li>
          <li className="mission">
            <Link to="/mission" className="footer-items">Search</Link>
          </li>
          <li className="help">
            <Link to="/help" className="footer-items">Market Watch</Link>
          </li>
        </ul>
    </div>
  );
}
